import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./ExpensesFilter";

function Expenses(props) {
  return (
    <div className="expenses">
      {props.expenses.map(function (item, index) {
        return (
          <div>
            <ExpensesFilter />
            <ExpenseItem
              title={item.title}
              amount={item.amount}
              date={item.date}
            />
          </div>
        );
      })}
    </div>
  );
}

export default Expenses;
